/// contentA : "&lt;p dir=&quot;RTL&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;color:rgba(0, 0, 0, 1)&quot;&gt;رؤية مصر 2030 محطة أساسية في مسيرة التنمية الشاملة في مصر تربط الحاضر بالمستقبل وتستلهم إنجازات الحضارة المصرية العريقة، لتبني مسيرة تنموية واضحة لوطن متقدم ومزدهر تسوده العدالة الاقتصادية والاجتماعية وتُعيد إحياء الدور التاريخي لمصر في الريادة الإقليمية. كما تمثل خريطة الطريق التي تستهدف تعظيم الاستفادة من المقومات والمزايا التنافسية، وتعمل على تنفيذ أحلام وتطلعات الشعب المصري في توفير حياة لائقة وكريمة.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;RTL&quot; style=&quot;text-align:justify&quot;&gt;وتعد أيضاً تجسيداً لروح دستور مصر الحديثة الذي وضع هدفاً أساسياً للنظام الاقتصادي تبلور في تحقيق الرخاء في البلاد من خلال التنمية المستدامة والعدالة الاجتماعية وأكد على ضرورة التزام النظام الاقتصادي بالنمو المتوازن جغرافياً وقطاعياً وبيئياً. وتعتبر أول استراتيجية يتم صياغتها وفقاً لمنهجية التخطيط الاستراتيجي بعيد المدى والتخطيط بالمشاركة، حيث تم إعدادها بمشاركة مجتمعية واسعة راعت مرئيات المجتمع المدني والقطاع الخاص والوزارات والهيئات الحكومية كما لاقت دعماً ومشاركة فعالة من شركاء التنمية الدوليين الأمر الذي جعلها تتضمن أهدافاً شاملةً لكافة مرتكزات وقطاعات الدولة المصرية.&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;RTL&quot; style=&quot;text-align:justify&quot;&gt;وتأتي أهمية هذه الاستراتيجية خاصةً في ظل الظروف الراهنة التي تعيشها مصر بأبعادها المحلية والإقليمية والعالمية والتي تتطلب إعادة النظر في الرؤية التنموية لمواكبة هذه التطورات ووضع أفضل السبل للتعاطي معها بما يمكن المجتمع المصري من النهوض من عثرته والانتقال إلى مصاف الدول المتقدمة وتحقيق الغايات التنموية المنشودة للبلاد. وقد تبنّت الاستراتيجية مفهوم التنمية المستدامة كإطار عام يُقصد به تحسين جودة الحياة في الوقت الحاضر بما لا يخل بحقوق الأجيال القادمة في حياة أفضل، ومن ثم يرتكز مفهوم التنمية الذي تتبنّاه الاستراتيجية على ثلاثة أبعاد رئيسية تشمل البعد الاقتصادي والبعد الاجتماعي والبعد البيئي.&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;RTL&quot; style=&quot;text-align:justify&quot;&gt;كما ترتكز الاستراتيجية على مفاهيم &amp;laquo;النمو الاحتوائي والمستدام والتنمية الإقليمية المتوازنة&amp;raquo; بما يؤكد مشاركة الجميع في عملية البناء والتنمية ويضمن في الوقت ذاته استفادة كافة الأطراف من ثمار هذه التنمية. وتراعي الاستراتيجية مبدأ تكافؤ الفرص وسد الفجوات التنموية والاستخدام الأمثل للموارد ودعم عدالة استخدامها بما يضمن حقوق الأجيال القادمة.&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;RTL&quot; style=&quot;text-align:justify&quot;&gt;وتقوم الدولة بتحديث أجندة التنمية المستدامة رؤية مصر 2030 (تعرف على أسباب التحديث) وذلك بمشاركة مختلف الوزارات والقطاع الخاص ومنظمات المجتمع المدني وبالاستعانة بعدد من أرفع الخبراء في مختلف المجالات. تقسم الرؤية في نسختها المحدثة المطروحة للحوار إلى ثمانية أهداف وطنية؛ ننشر هنا تعريفات مختصرة عن هذه الأهداف والأهداف الفرعية لكل منها. اقرأها وإذا اردت المشاركة أرسل لنا رأيك أو مقترحك بشأن أي منها (شارك) وسيتم أخذ كافة المشاركات الجادة في الاعتبار في الصياغة النهائية وذلك كجزء من الحوار المجتمعي السابق لإطلاق أجندة التنمية المستدامة رؤية مصر 2030 في شكلها الكامل قريباً.&lt;/p&gt;\r\n"
/// contentE : "<p style=\"text-align:justify\">Egypt&#39;s Vision 2030 is a key milestone in its comprehensive development process, linking the present to the future and inspired by the achievements of the ancient Egyptian civilization, to adopt a clear development path for a developed and prosperous homeland where economic and social justice prevails and to revive Egypt&#39;s historical role in regional leadership. The vision also represents the roadmap that aims to optimize the competitive components and advantages, and works to implement the dreams and aspirations of the Egyptian people in providing a decent and dignified life.</p>\r\n\r\n<p style=\"text-align:justify\">It is also an embodiment of the spirit of the modern Egyptian Constitution that sets a fundamental goal for the economic system, crystallized in achieving prosperity in the country through sustainable development and social justice. It stressed the need for the economic system to maintain a balanced growth geographically, sectorally and environmentally. It is the first strategy to be formulated in accordance with the methodology of long-term strategic planning and participatory planning. It was prepared with broad community participation that considered the visions of civil society, the private sector, ministries and government agencies, as well as the support and active participation of international development partners. Accordingly, it includes comprehensive objectives for all pillars and sectors of the Egyptian state.</p>\r\n\r\n<p style=\"text-align:justify\">The importance of this strategy comes especially in light of the current circumstances in Egypt with its local, regional and global dimensions, which require a review of the development vision to keep pace with these developments and devise the best ways to deal with them so as to enable Egyptian society to rise from its stumbling and move to the ranks of developed countries and achieve the desired development goals for the country. The strategy has adopted the concept of sustainable development as a general framework intended to improve the quality of life at the present time, without prejudice to the rights of future generations to a better life. Thus, the concept of development adopted by the strategy is based on three main dimensions, including the economic, social and environmental ones.</p>\r\n\r\n<p style=\"text-align:justify\">The strategy is also based on the concepts of &quot;inclusive and sustainable growth and balanced regional development&quot;, which emphasizes the participation of all in the process of construction and development, while ensuring that all parties benefit from the fruits of this development. The strategy takes into account the principle of equal opportunities, bridging development gaps, optimizing the use of resources and supporting the fair use of resources to ensure the rights of future generations.</p>\r\n"
